import {Button, NavLink} from 'react-bootstrap';
import {Link} from 'react-router-dom'

function TypesExample() {
  return (
    <>
    <NavLink href='/HOLA'><Button>Quiero saber mas</Button></NavLink>
      <Button variant="secondary">Vendedor</Button>{' '}
      <Button variant="warning">Comprador</Button>{' '}

    </>
  );
}

export default TypesExample;
